import "./App.css";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/signIn" element={<SignInForm />} />
        <Route path="/signUp" element={<SignUpForm />} />
        <Route path="/create-request" element={<CreateRequest />} />
        <Route path="/chatbox" element={<Chatbox />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
